import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';

const Selector = props => (
    <select>
      <option value="Atlanta,US" onClick={props.handleButtonSelect}>Atlanta,US</option>
      <option value="London,UK" onClick={props.handleButtonSelect}>London,UK</option>
      <option value="Bujumbura,BI" onClick={props.handleButtonSelect}>Bujumbura,BI</option>
    </select>
)

export default Selector;
